import axios from 'axios';

function App() {
  return (
    <div className="App">
        <div className="container">
            <h2>Products</h2>
            <table>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Description</th>
                    <th>Price</th>
                    <tr>
                        <td>Ola</td>
                        <td>Ola</td>
                        <td>Ola</td>
                        <td>Ola</td>
                    </tr>
            </table>
        </div>
    </div>
  );
}

export default App;
